import React from "react";
import employeeService from "../services/EmployeeService";
import Employee from "./Employee";

export default class CreateEmployee extends React.Component<Employee, any> {
    constructor(props: any) {
        super(props);
        this.state = {
            isCreated: false,
             name:'',
             company:'',
              month:'',
              value:''
          
        }
    }
    componentDidMount() {
    }
    handleChange(event) {
        this.setState({value: event.target.value});
        
      }
    handleSubmit() {
      // employeeService.create()
    }

    render() {
        return (
            <div className="container">
                <h2>Create</h2>
                <form onSubmit={this.handleSubmit} >
                    <div className="form-group">
                        <input type='text' className="form-control" placeholder="Name" 
                      value={this.state.value} onChange={this.handleChange} />
                    </div>
                    <div  className="form-group">
                        <input type='text' className="form-control mt-2" placeholder="Compant" />
                    </div>
                    <div className="form-group">
                        <input type='date' className="form-control mt-2" placeholder="Date" />
                    </div>
                    <div  className="form-group">
                        <input type='submit' className="btn btn-primary mt-2" value='Save' />
                    </div>
                </form>
            </div>
        )
    }
}
